css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label > I {display: none}
.new_post_label {
  background-clip: content-box;
  padding: 39px 1px 40px 0 !important;
  color: transparent !important;
}
.new_post_label:hover > SPAN {
  color: white !important;
  background-color: rgba(0,0,0,.7) !important;
  font-weight: bold !important;
}
.new_post_buttons {
  background: white center no-repeat url('data:image/jpeg;base64,') !important;
}

}
